import React, { useEffect } from "react";

export default function Script() {
    useEffect(function mount() {
      function onScroll() {
        console.log("scroll!");
      }
  
      window.addEventListener("scroll", onScroll);
  
      return function unMount() {
        window.removeEventListener("scroll", onScroll);
      };
    });
  
    return null;
  }
